import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-flight-information',
  templateUrl: './flight-information.component.html',
  styleUrls: ['./flight-information.component.css']
})
export class FlightInformationComponent implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}
<table mat-table class="mat-elevation-z8">

  <ng-container matColumnDef="planeNumber">
    <td mat-cell *matCellDef="let element"> plane Number </td>
  </ng-container>

  <ng-container matColumnDef="duration">
    <td mat-cell *matCellDef="let element"> Duration </td>
  </ng-container>

  <ng-container matColumnDef="originGate">
    <td mat-cell *matCellDef="let element"> Origin Gate </td>
  </ng-container>

  <ng-container matColumnDef="destinationGate">
    <td mat-cell *matCellDef="let element"> Destination Gate </td>
  </ng-container>

